insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (5, 'Vince', 'Vasyukhnov', '+886 368 572 4858', 'vvasyukhnovd@ihg.com', 'mIXZx3AwpEPH', 'Burnaby', '7 Butterfield Court', 'V2U 8H6', false, 'orchestrate next-generation ROI', true, true, '');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (6, 'Sobina', 'Crose', '+16047156745', 'jcrose1@simplemachines.org', 'NSwmlYS30QuI', 'Coquitlam', '24 Caliangt Parkway', 'V2U 8Y6', true, 'My name is Sobina , I am 20 years old. I have five nieces and nephews all under the ages of four. For the first 2 years of their lives I played a huge roll in raising one of my nieces and one of my nephews. I started babysitting two boys ages one and three at twelves years old, was their babysitter for two years. I have my First aid level three certification, I also have my Class 7 drivers license (N) so limited to passengers.', true, false, 'https://image.shutterstock.com/image-photo/young-african-american-woman-standing-600w-1668825967.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (7, 'Merrielle', 'Hendriks', '+380 456 747 8513', 'mhendriks2@wordpress.com', 'on0qIpeN', 'Port Coquitlam', '0375 Scoville Way', 'V8U 8H6', true, 'My name is Merrielle and I am 28 years old. I learned in my late teens that children are my passion. Growing up I baby sat for families in my neighbourhood and during my dance training I was a teachers assistant for 4 years working with kinder dance classes. After graduating I was hired by Dunbar Community Centre to teach dance classes on Saturday mornings. I was working with young children between the ages of 1-7 in these classes. Your children will be my priority. I understand being reliable and having time management is of the utmost importance. I have my own car and am more than willing to drive where I need to go.', true, true, 'https://image.shutterstock.com/image-photo/young-chinese-woman-wearing-turtleneck-600w-1571480824.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (8, 'Anna', 'Durand', '+86 898 150 6598', 'ddurand3@ox.ac.uk', 'BOP87K', 'Burnaby', '3096 Merchant Center', 'V2U 8H6', true, 'Hello! My name is Anna, a teacher-psychologist by profession. I often spend time and play with the children of relatives and close friends (from one month to 12 years). I try to spend my free time usefully. I love walking in the fresh air. I am fond of sewing, modeling, drawing, I like to collect puzzles and read. Ready to work with babies. I have a good experience of working with special children', true, false, 'https://image.shutterstock.com/image-photo/senior-greyhaired-woman-wearing-striped-600w-1543963523.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (9, 'Lauri', 'Coniff', '+86 766 928 4553', 'lconiff4@shutterfly.com', 'VID4VU', 'Port Coquitlam', '38 Hollow Ridge Park', 'V2U 8H6', true, 'My name is Lauri, I am 22 years old. I graduated from the construction college in 2020, and now I am studying at the UBC University of Civil Engineering. I like to spend my free time with friends and play sports. I spend time with my brother, as well as my nephew, who is now 11 months old, so I get along well with babies.', true, true, 'https://image.shutterstock.com/image-photo/young-beautiful-brunette-woman-wearing-600w-1696525717.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (10, 'Cristie', 'Owen', '+86 249 267 7765', 'cowen5@paginegialle.it', 'TMbZOkc8', 'Coquitlam', '8068 Esker Place', 'V2U 8H6', true, 'Hello, dear parents! My name is Christie, I am 25 years old. I have experience working with children - I worked as a taekwondo coach at a sports school, a counselor at a summer camp, a kindergarten teacher, looked after my brothers and sisters. There is also a little experience with babies (goddaughter).', true, false, 'https://image.shutterstock.com/image-photo/young-black-woman-braids-wearing-600w-1865182558.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (11, 'Lamara', 'McIlreavy', '+86 210 722 4686', 'lmcilreavy8@tinypic.com', 'lqw6TmdmSnG', 'Port Coquitlam', '61 Lyons Plaza', 'V2U 8H6', true, 'Hello! My name is Lamara, I am 24 years old. Work experience: 1 year worked as a nanny with a 3-year-old child, also hung out with nephews and nieces since their birth. I love dynamism and a diverse approach to everything. I am ready to actively spend time with your child, playing outdoor games, and calmly draw, read books, play board games. The desire to spend more time with children was the main reason for choosing to work as a babysitter.', true, true, 'https://image.shutterstock.com/image-photo/young-brunette-woman-wearing-casual-600w-1874800516.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (12, 'Miko', 'Trendle', '+84 575 555 3962', 'ztrendle9@woothemes.com', 'RCfh2auwe', 'Port Coquitlam', '9 Spenser Alley', 'V2U 8H6', true, 'I am Miko, I am 20 years old. I am studying at a medical college. In my free time I like to spend time in nature (walking in parks), I am fond of psychological literature. I have extensive experience working with children. I often stayed with the children of my friends, the age of the children mostly ranged from 3-6 months to 12 years.', true, false, 'https://image.shutterstock.com/image-photo/young-asian-woman-wearing-casual-600w-1874719606.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (13, 'Martina', 'Dairton', '+86 951 918 1869', 'mdairtona@goodreads.com', 'sz6YFX4er', 'Port Coquitlam', '2 Aberg Place', 'V2U 8H6', true, 'Hello! My name is Martina. At the moment I am studying at Langara College and Arts in the choreographic direction. I have experience working with children. Often looked after nephews and friends children, and also introduced children dance groups (4-9 years old).', true, false, 'https://image.shutterstock.com/image-photo/chinese-woman-wearing-casual-tshirt-600w-1530741143.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (14, 'Asya', 'L''Hommee', '+372 795 723 6111', 'klhommeee@weebly.com', 'xScuu3QPwzaR', 'Burnaby', '69 Brentwood Circle', 'V2U 8H6', true, 'Hello, dear parents!My name is Asya, I am 19 years old.I am studying at TSU with a degree in Linguistics. I have experience working with children, as I looked after my younger brother and sister. For some time she was a tutor for preschool and school-age children. With your child, I can play various games, draw, read, do homework, take a walk, feed and put to bed.', true, false, 'https://image.shutterstock.com/image-photo/young-blonde-woman-wearing-casual-600w-1913299138.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (15, 'Knoxy', 'Zellick', '+46 195 359 4937', 'kzellickf@yolasite.com', '510hfQgDx', 'Burnaby', '6 Pine View Avenue', 'V2U 8H6', true, 'I am a student of UBC, specialty speech pathologist-speech therapist. I am fond of movies, reading fiction and poetry (if you need to prepare a poem for kindergarten, school, holiday, I will be happy to help). Taking into account all the features and interests of your child and recommendations to parents, we will play interesting games, eat, walk, do crafts and even homework (to kindergarten or school). I can pick up your child from the section or from school', true, true, 'https://image.shutterstock.com/image-photo/young-beautiful-hispanic-woman-wearing-600w-1812277708.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (16, 'Mariya', 'Poyser', '+86 495 925 2243', 'mpoyserq@imageshack.us', 'd3JL8MR2ND5', 'Coquitlam', '68 Boyd Court', 'V2U 8H6', true, 'My name is Mariya and I am a babysitter! I am 19 years old. I am studying in the 2nd year of VCC in Obstetrics. Ready to travel to any point. In my free time I like to read books, swim, stretch. I can have a lot of fun with your child. We will play, dance, draw, walk. I can pick him/her up from school or a section, kindergarten. Experience working with children: I have a skill in raising my niece for 5 years, since birth I have been helping my sister with her. I also had an internship and then a job in a maternity hospital for about 4 months and was taught how to care for babies.', true, false, 'https://image.shutterstock.com/image-photo/young-brunette-woman-wearing-casual-600w-1914125059.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (17, 'Kerrin', 'Jerzykiewicz', '+86 724 311 7867', 'kjerzykiewiczs@google.ru', 'adDLsxcP3GFv', 'Port Coquitlam', '7 Dryden Parkway', 'V2U 8H6', true, 'My name is Kerrin, 22 years old. I am a 3rd year student of SFU. I like to do active sports, long walks. I will be glad to play board games with your child, collect puzzles, lego, draw, as well as take a walk. I have a lot of experience looking after children, because I myself come from a large family. I often had to stay with young children, where I was only happy to spend time with them. My love for children pushed me to become a babysitter, as well as the fact that I can easily make friends with any child and find a joint occupation.', true, false, 'https://image.shutterstock.com/image-photo/young-handsome-man-wearing-casual-600w-1696726210.jpg');
insert into users (id, first_name, last_name, phone, email, password, city, address, zip, babysitter, bio, has_first_aid, has_police_check, photo) values (18, 'Hugo', 'Jozsika', '+81 417 284 8067', 'hjozsikat@reuters.com', 'KgP85f4', 'Port Coquitlam', '79825 Burning Wood Junction', 'V2U 8H6', true, 'My name is Hugo, I am 19 years old, I study at SFU as a teacher of physical culture. I am ready to work with children from 5 years old. There is a younger sister, I have been hanging out with her since I was born. He also had an internship at a children school. I love children. We can play mobile and quiet games with your child, do exercises or do physical education, as well as do modeling and drawing. I work as a baby sitter, as it is a useful experience in communicating with children, a free schedule that does not interfere with my studies.', true, true, 'https://image.shutterstock.com/image-photo/young-african-american-man-wearing-600w-2029465580.jpg');
